import logo from "./logo.svg";
import "./App.css";
import { useState, useEffect } from "react";
import { Dashboard } from "./pages/Dashboard";
import Header from "./components/Header";
import Navbar from "./components/Navbar";
import { Routes,Route } from "react-router-dom";
function App() {
  const [data, setData] = useState(null);

  useEffect(() => {
    fetch("/api")
      .then((res) => res.json())
      .then((data) => {
        console.log(data)
        // setData(data)
      });
  }, []);

  console.log(data)

  return (
    <div className="App">
        {/* This will be the top dashboard */}
        <Header/>
        {/* This will be the side dashboard */}
        <Navbar/>
        {/* This will be the main dashboard */}
       {/* <Dashboard/> */}
       {/* {This will be the page where the user can see their friends and add new friends} */}
       <Routes>
          <Route path="/" element={<Dashboard/>}/>
          <Route path="/friends" element={<Dashboard/>}/>
       </Routes>
    </div>
  );
}

export default App;
